import React from 'react'
import {  Header, Container } from 'semantic-ui-react'


export default function Home() {
  const handleMouseOver = (evt) => {
    console.log(evt.target)
    switch (evt.target.innerHTML) {
      case 'Guligena Aierken':
        evt.target.innerHTML = '古丽格娜艾尔肯'
        break;
      case '古丽格娜艾尔肯':
        evt.target.innerHTML = 'Gülginä Ärkin'
        break;
      case 'Gülginä Ärkin':
        evt.target.innerHTML = 'گۈلگىنە ئەركىن'
        break;
      default:
        evt.target.innerHTML = 'Guligena Aierken'
        break;
    }
  }  
  return (

        <React.Fragment>
          <Container className="home">
            <Header onMouseOver={handleMouseOver}textAlign='center' className="home my name">Guligena Aierken</Header>
            <Header textAlign='center' className="home my job title ">Full Stack Developer | Software Engineer</Header>
          </Container> 
        </React.Fragment>
    )
}
